const mainPic = `data:image/jpeg;base64,`;

// document.mainPic = mainPic;

// set in main pic
const mainPicElem = document.querySelector('#mainPic');
mainPicElem.src = mainPic;

// set in metaTags
const metaTags = document.createDocumentFragment();

let tag; 
tag = document.createElement('meta');
tag.name = 'twitter:image:src';
tag.content = mainPic;
metaTags.append(tag);

tag = document.createElement('meta');
tag.name = 'og:image';
tag.content = mainPic;
metaTags.append(tag);


// set metaTags in head
const head = document.querySelector('head');
head.appendChild(metaTags)